import React from "react"

export default WebsocketStatus = ({ isConnected }) => {
    const circleSize = 20;
    const circleStyle = {
        position: "fixed",
        bottom: 20,
        right: 20,
        width: circleSize,
        height: circleSize,
        borderRadius: "50%",
        backgroundColor: isConnected ? "green" : "red"
    };

    return <div style={circleStyle}></div>;
}
